import React from "react";
import { useState } from "react";


const Contact = () => {

        const [formData, setFormData] = useState({ name: "", email: "", message: "" });

        return (
                <div className="relative min-h-screen bg-[#F5ECE3] flex items-center justify-center p-6">
                        {/* Background Design */}
                        <div className="absolute inset-0 bg-gradient-to-b from-[#FAF5F0] to-[#F5ECE3]"></div>

                        {/* Floating Contact Card */}
                        <div className="relative z-10 w-full max-w-4xl bg-white shadow-2xl rounded-3xl p-10 border border-[#D8B6A4] flex flex-col md:flex-row items-center md:items-start">

                                {/* Left - Contact Info & Social Links */}
                                <div className="md:w-1/2 w-full flex flex-col items-center md:items-start text-center md:text-left">
                                        <h2 className="text-3xl font-bold text-[#B88E8D]">Get in Touch</h2>
                                        <p className="text-gray-600 mt-2">We’d love to hear from you!</p>

                                        {/* Contact Details */}
                                        <div className="mt-6 space-y-4 text-[#B88E8D]">
                                                <p className="flex items-center space-x-3 text-gray-700"><span>📍</span> <span>123 Business St, City</span></p>
                                                <p className="flex items-center space-x-3 text-gray-700"><span>📞</span> <span>+123 456 7890</span></p>
                                                <p className="flex items-center space-x-3 text-gray-700"><span>📧</span> <span>support@ecommerce.com</span></p>
                                        </div>

                                        {/* Social Links */}
                                        <div className="mt-6 flex space-x-4">
                                                <a href="#" className="text-[#B88E8D] text-2xl hover:scale-110 transition">🌐</a>
                                                <a href="#" className="text-[#B88E8D] text-2xl hover:scale-110 transition">📸</a>
                                                <a href="#" className="text-[#B88E8D] text-2xl hover:scale-110 transition">🐦</a>
                                        </div>
                                </div>

                                {/* Right - Contact Form */}
                                <div className="md:w-1/2 w-full mt-8 md:mt-0">
                                        <form className="space-y-5">
                                                <div className="relative">
                                                        <input
                                                                type="text"
                                                                value={formData.name}
                                                                onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#FAF5F0] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D] transition"
                                                                placeholder="Your Name"
                                                                required
                                                        />
                                                        <span className="absolute left-4 top-1/2 transform -translate-y-1/2 text-[#B88E8D]">👤</span>
                                                </div>

                                                <div className="relative">
                                                        <input
                                                                type="email"
                                                                value={formData.email}
                                                                onChange={(e) => setFormData({ ...formData, email: e.target.value })}
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#FAF5F0] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D] transition"
                                                                placeholder="Your Email"
                                                                required
                                                        />
                                                        <span className="absolute left-4 top-1/2 transform -translate-y-1/2 text-[#B88E8D]">📧</span>
                                                </div>

                                                <div className="relative">
                                                        <textarea
                                                                value={formData.message}
                                                                onChange={(e) => setFormData({ ...formData, message: e.target.value })}
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#FAF5F0] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D] transition"
                                                                rows="4"
                                                                placeholder="Write your message..."
                                                                required
                                                        ></textarea>
                                                        <span className="absolute left-4 top-4 text-[#B88E8D]">✉️</span>
                                                </div>

                                                <button className="w-full bg-[#B88E8D] text-white font-semibold py-3 rounded-lg shadow-md hover:bg-[#A17A7A] transition duration-300">
                                                        Send Message
                                                </button>
                                        </form>
                                </div>
                        </div>
                </div>

        );
};

export default Contact;
